export default function Hero() {
  return (
    <div id='hero'>
         <div className="hero_intro"><h1>Hey ,
I am Ishika, a UX 
designer based in India. I create designs that are 
human-centric</h1></div>

      <div className='hero_banner'></div>

    </div>
  )
}
